const pdf = require('html-pdf')
const marked = require('marked')

const options = {
  format: 'A4',
  border: '13mm',
  quality: '95'
}

const Event = function (req, res, data, callback) {

const html = `
<!DOCTYPE html>
<html>
<head>
<style>
@font-face {
  font-family: 'dadifont';
  src: url('data:application/x-font-woff;base64,')
  font-style: normal;
  font-weight: normal;
}

@font-face {
  font-family: 'dadifont';
  src: url('data:application/x-font-woff;base64,')
  font-style: normal;
  font-weight: bold;
}

* {
  margin: 0;
  padding: 0;
}
body {
  font-family: 'dadifont','Helvetica Neue',helvetica,arial,sans-serif;
  color: #04111d;
}
#logo {
  width: 130px;
  height: 30px;
  margin-top: 30px;
}
h1 {
  border-top: 4px solid #f9f9f9;
  font-size: 22px;
  padding-top: 30px;
  margin-bottom: 5px;
}
h2 {
  color: #8f8f90;
  font-size: 16px;
  margin-bottom: 20px;
  margin-top: 0;
}
p {
  line-height: 20px;
  font-size: 16px;
  margin-bottom: 1.2em;
}
img {
  float: right;
  margin: -70px 0 30px 30px;
}
.team {
  page-break-after:always;
  display:block;
}
</style>
</head>
<body>

<div id="pageFooter">
<svg id="logo" viewBox="0 0 497.94 116.39" xmlns="http://www.w3.org/2000/svg"><g fill="#21262d"><path d="m300.72 11.21v96.57h-20.72v-6.48c-4.55 5.24-11.31 8.42-20.56 8.42-18.07 0-33-15.86-33-36.42s14.9-36.42 33-36.42c9.24 0 16 3.17 20.56 8.42v-34.09zm-20.72 62.08c0-10.35-6.9-16.83-16.42-16.83s-16.38 6.49-16.38 16.83 6.9 16.83 16.42 16.83 16.38-6.48 16.38-16.83zm102.09-34.48v69h-20.7v-6.51c-4.55 5.24-11.31 8.42-20.56 8.42-18.07 0-33-15.86-33-36.42s14.9-36.42 33-36.42c9.24 0 16 3.17 20.56 8.42v-6.49zm-20.7 34.48c0-10.35-6.9-16.83-16.42-16.83s-16.42 6.48-16.42 16.83 6.9 16.83 16.42 16.83 16.42-6.48 16.42-16.83zm102.06-62.08v96.57h-20.7v-6.48c-4.55 5.24-11.31 8.42-20.56 8.42-18.07 0-33-15.86-33-36.42s14.9-36.42 33-36.42c9.24 0 16 3.17 20.56 8.42v-34.09zm-20.7 62.08c0-10.35-6.9-16.83-16.42-16.83s-16.42 6.48-16.42 16.83 6.9 16.83 16.42 16.83 16.42-6.48 16.42-16.83zm30.36-52.97a12.42 12.42 0 0 1 24.83 0 12.42 12.42 0 1 1 -24.83 0zm2.07 18.49h20.69v69h-20.7zm-358.65 31.13a11.74 11.74 0 1 0 0-23.48h-66.82a11.74 11.74 0 0 0 0 23.48z"/><path d="m123.85 0h-35.85a11.74 11.74 0 1 0 0 23.48h35.4a34.7 34.7 0 1 1 0 69.41h-35.4a11.74 11.74 0 1 0 0 23.48h35.82a58.19 58.19 0 0 0 .03-116.37zm-78.36 23.48a11.74 11.74 0 1 0 0-23.48h-33.75a11.74 11.74 0 0 0 0 23.48z"/></g></svg>
</div>

${data.team.results.map(i => `

<div class="team">
  <h1>${i.name}</h1>
  <h2>${i.role || 'Advisor'}</h2>  

  <img src="${data.global.cdn.publicUrl}${i.image[0].path}?q=80&w=300" width="150" height="150" alt="Photo of ${i.name}">

  ${marked(i.body)} 

  <p>
    ${i.personalSite ? `<a href="${i.personalSite}" class="btn" target="_blank" rel="noopener">${i.personalSite}</a><br>` : ''}
    ${i.twitter ? `<a href="https://twitter.com/${i.twitter}" class="btn" target="_blank" rel="noopener">https://twitter.com/${i.twitter}</a><br>` : ''}
    ${i.linkedIn ? `<a href="https://linkedin.com/${i.linkedIn}" class="btn" target="_blank" rel="noopener">https://linkedin.com/${i.linkedIn}</a><br>` : ''}
  </p>
</div>

`).join('\n')}

</body>
</html>
`

  pdf
    .create(html, options)
    .toBuffer((err, buffer) => {
      if (err) res.end(`Something went wrong making the PDF (${err}).`)

      // Set headers
      res.setHeader('Content-disposition', `attachment; filename="dadi-biographies.pdf"`);
      res.setHeader('Content-type', 'application/pdf')
      
      // Send pdf
      res.end(buffer)
      
      callback()
    })
}

module.exports = function (req, res, data, callback) {
  return new Event(req, res, data, callback)
}

module.exports.Event = Event
